import React from 'react';
import Head from 'next/head';
import Link from 'next/link';
import Router from 'next/router';
import nextCookies from 'next-cookies';
/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css } from '@emotion/core';
import Header from '../components/Header';

//================================================================================
// Style
//================================================================================

const app = css`
  background: #4abdac;
  min-height: 100vh;
  font-weight: 400;
  font-family: 'Karla', sans-serif;
  width: 100%;
  position: absolute;
`;
const form = css`
  background: #f7b733;
  width: 200px;
  position: relative;
  margin: auto;
  margin-top: 10%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  padding: 20px;
  border-radius: 6px;
`;

const input = css`
  line-height: 2.5;
  margin-bottom: 15px;
  border-radius: 4px;
  border: 2px solid #f7b733;
  margin-top: 20px;
  font-family: 'Karla', sans-serif;
`;

const button = css`
  border-radius: 4px;
  font-family: 'Karla', sans-serif;
  font-size: 18px;
  margin-top: 10px;
  background: #ffff;
  border: 2px solid #2f4f4f;
`;

const forgottenPass = css`
  text-align: center;
  color: #323339;
  font-size: 18px;
  font-family: 'Karla', sans-serif;
  display: flex;
  flex-direction: column;
  justify-content: center;
  margin: 15px;
  text-decoration: none;
`;

const logo = css`
  font-size: 40px;
  color: #555555;
  display: inline-block;
  margin-left: 20px;
  margin-top: 20px;
  font-family: 'Karla', sans-serif;
  text-decoration: none;
  border: 2px solid #555555;
`;

//================================================================================
// Function
//================================================================================
export default function contact() {
  return (
    <>
      <form
        action="mailto:gaby.peta@gmail.com?subject=Wolfi%20Desktop%20Application."
        method="post"
      >
        <table border="0" cellspacing="0" cellpadding="4" width="90%">
          <tr>
            <td width="30%">
              <div align="right">
                <b>Name:</b>
              </div>
            </td>
            <td width="70%">
              <input
                type="text"
                name="name"
                size="20"
                placeholder="Name"
                required
              />
            </td>
          </tr>

          <tr>
            <td>
              <div align="right">
                <b>Email:</b>
              </div>
            </td>
            <td>
              <input type="email" name="email" size="20" placeholder="Email" />
            </td>
          </tr>

          <tr>
            <td>
              <div align="right">
                <b>Comments:</b>
              </div>
            </td>
            <td>
              <textarea
                name="comments"
                cols="30"
                rows="4"
                wrap="virtual"
                placeholder="Speak your mind!"
              ></textarea>
            </td>
          </tr>

          <tr>
            <td>&nbsp;</td>
            <td>
              <input type="submit" name="submit" value="Submit" />
              <input type="reset" name="reset" value="Reset" />
            </td>
          </tr>
        </table>
      </form>
    </>
  );
}
